import React from "react";
import ArticleFormFields from "./ArticleFormFields";


function ArticleFormEdit(){
    useEffect(()=>{
        var elems = document.querySelectorAll('.sidenav');
        var instances = M.Sidenav.init(elems, {});
    },[])


    function submitHandler(event){
        event.preventDefault()
    }
    return(
        <>
             <div className="row">
            
            <div className="adm-form col s12 m12">
           
                <form onSubmit={submitHandler} method="post" enctype="multipart/form-data">
               
                        <ArticleFormFields title="Edit Article"/>
                     <div className="row">
                    <div  className="input-field col s3 offset-s5  m2 offset-m5  l1 offset-l4  btn-form">
                        <button type="submit" className="btn blue waves-effect waves-light">Update</button>
                    </div>
                    <div  className="input-field col s3 offset-s5  m2 offset-m5  l1 offset-l4  btn-form">
                        <button type="submit" className="btn red accent-3 waves-effect waves-light">Delete</button>
                    </div>
                   
                           
                    </div>
                </form>
                <div  className="form-delete col s1 offset-s5  m1 offset-m5  l1 offset-l4 ">
                     <form onSubmit={submitHandler} method="post">
                        <button type="submit" className="btn red accent-3 waves-effect waves-light">Delete</button> 
                    </form> 
            </div>           
            </div>
        </div>
        </>

    )
}

export default ArticleFormEdit
